import { Link } from "react-router-dom";
import { getProjects } from "../ProjectInfo";

function Projects() {
    let projects = getProjects();
    return (
        <>
            <h1>Projects Content</h1>
            <nav>
                {projects.map(el => (
                    <Link to={`/projects/${el.pid}`} key={el.pid}>{el.client}</Link>
                ))}
            </nav>
        </>
    );
}

export default Projects;
